export class Background implements base64Image {

    public imageElement: string;
    public cssBackground: string;
    public backgroundCSSJSON: {};
    public backgroundCSSJSONTop: {};

    constructor (
    ){
        this.cssBackground = "url('data:image/png;base64,')";
        this.imageElement = 'data:image/png;base64,'
        this.backgroundCSSJSON = {
            'background': this.cssBackground + 'no-repeat center center fixed',
            '-webkit-background-size': 'cover',
            '-moz-background-size': 'cover',
            'o-background-size': 'cover',
            'background-size': 'cover',
        }
        this.backgroundCSSJSONTop = {
            'background': this.cssBackground,
            'background-position': 'center',
            'background-repeat': 'repeat',
            '-webkit-background-size': 'cover',
            '-moz-background-size': 'cover',
            'o-background-size': 'cover',
            'background-size': 'cover',
        }
    }
}

